import axios from 'axios';

const BASE_URL = 'http://localhost:5000/api';
const Token = "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY1ZTIyY2UwNWM3MTRmYWIwYjE0ZDEwMyIsImlzQWRtaW4iOnRydWUsImlhdCI6MTcxNjczNjA2MywiZXhwIjoxNzE2OTk1MjYzfQ.DiF9YiCLp7W2iGT2Z7afPfWi0vtecc0ZcDLt1CAXJ8Q"

export const publicRequest = axios.create({
    baseURL: BASE_URL
});

export const userRequest = axios.create({
    baseURL: BASE_URL,
    headers: { token: `Bearer ${Token}` }
});
